import React, { useState } from 'react';
import './App.css';

function App() {
  const [eventType, setEventType] = useState('100m');
  const [performance, setPerformance] = useState('');
  const [points, setPoints] = useState(null);

  const calculatePoints = async () => {
    try {
      const response = await fetch('http://localhost:5001/api/calculate-points', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ event_type: eventType, performance: performance }),
      });
      const data = await response.json();
      setPoints(data.points);
    } catch (error) {
      console.error('Error:', error);
    }
  };

  return (
    <div className="App">
      <h1>IAAF Points Calculator</h1>
      <div>
        <select value={eventType} onChange={(e) => setEventType(e.target.value)}>
          <option value="100m">100m</option>
          {/* Add more events as needed */}
        </select>
        <input
          type="number"
          value={performance}
          onChange={(e) => setPerformance(e.target.value)}
          placeholder="Enter performance"
        />
        <button onClick={calculatePoints}>Calculate Points</button>
      </div>
      {points && <div>Points: {points}</div>}
    </div>
  );
}

export default App;
